import React from 'react';
import axios from 'axios';
import { Link as RouterLink } from 'react-router-dom';
import { IconButton, AppBar, Toolbar } from '@material-ui/core';
import ArchiveIcon from '@material-ui/icons/Archive';
import WarningIcon from '@material-ui/icons/Warning';
import DeleteIcon from '@material-ui/icons/Delete';
import MarkunreadIcon from '@material-ui/icons/Markunread';
import SnoozeIcon from '@material-ui/icons/Snooze';
import MoveToInboxIcon from '@material-ui/icons/MoveToInbox';
import LabelIcon from '@material-ui/icons/Label';
import MoreVertIcon from '@material-ui/icons/MoreVert';
import ArrowBackIcon from '@material-ui/icons/ArrowBack';

class NavBar extends React.Component {
    constructor(props) {
        super(props)
        const dt = new Date()
        this.state = {
            start: dt,
            lastClickTime: dt
        }
    }

    logClick = (e) => {
        const dt = new Date()
        axios({
            method: 'post',
            url: 'http://localhost:8080/logging',
            data: {
                id: e.currentTarget.id,
                time: (dt - this.state.start) / 1000
            }
        })

    }

    render() {
        return (
            <AppBar>
                <Toolbar>
                    <IconButton id="archive" color="inherit" component={RouterLink} to="/page" onClick={this.logClick}>
                        <ArchiveIcon/>
                    </IconButton>
                    <IconButton id="warning" color="inherit" onClick={this.logClick}>
                        <WarningIcon/>
                    </IconButton>
                    <IconButton id="delete" color="inherit" onClick={this.logClick}>
                        <DeleteIcon/>
                    </IconButton>
                    <IconButton id="unread" color="inherit" onClick={this.logClick}>
                        <MarkunreadIcon/>
                    </IconButton>
                    <IconButton id="snooze" color="inherit" onClick={this.logClick}>
                        <SnoozeIcon/>
                    </IconButton>
                    <IconButton id="move" color="inherit" onClick={this.logClick}>
                        <MoveToInboxIcon/>
                    </IconButton>
                    <IconButton id="label" color="inherit" onClick={this.logClick}>
                        <LabelIcon/>
                    </IconButton>
                    <IconButton id="more" color="inherit" onClick={this.logClick}>
                        <MoreVertIcon/>
                    </IconButton>
                    <IconButton id="home" color="inherit" component={RouterLink} to="/" onClick={this.logClick}>
                        <ArrowBackIcon/>
                    </IconButton>
                </Toolbar>
            </AppBar>
        );
    }
}

export default NavBar;
